import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#1C1C1C',
    width: '100%',
    height: 60,
    alignItems: 'flex-start',
    paddingLeft: 12,
    paddingTop: 10
  },
  logo: {
    width: 121,
    height: 38,
  },
});

export default styles;
